import axios from 'axios';

var base = 'http://localhost:3000'

const instance = axios.create({
    timeout: 1000,
});

async function getItems() {
    let items = await instance.get(base+'/items');
    //let items = await instance.get({
        //url: base+'/items',
    //});
    return items;
}

export { getItems };
